    console.log('https://jsonplaceholder.typicode.com/posts/' + id)
  }

const ArticleListItem = (props) =>{
    const {title, body, id} = props
    return <li>
        <p>{id}</p>
        <p>{title}</p>
        <p>{body}</p>
        <button onClick={deleterticle(id)}>delete</button></li>
} 

export default ArticleListItem
